import { useEffect, useState } from 'react';
import {default as Api} from '../utils/Api.js'
function Card() {
const[initialCards,Setcarddata]= useState(0)
   useEffect(()=>{
        Api.getMassCards()
        .then((res)=>{
            console.log(res)
            Setcarddata(res)
    })
   },[])
   console.log(initialCards)
const NewsCard =(attributeCart)=>{
    return(
       <article class="element">
        <button class ="element__delete">
        </button>
       <img class="element__photo" src={attributeCart.link ? attributeCart.link : 'ошибка'} alt={attributeCart.name ? attributeCart.name : 'ошибка'} />
       <div class="element__description">
        <h2 class="element__header">{attributeCart.name ? attributeCart.name : 'ошибка'}</h2>
       <div class = "element__like-contaner">
        <button type="button" class="element__like-button"></button>
        <span class="element__likes-number"></span>
       </div>
       </div>
       </article> 

    )
}
const CreatCart=()=>{
initialCards.forEach(element => {
    console.log(element)
     NewsCard(element)
})
}
return CreatCart
}
export default Card
